    true,nt"url": null,nt"notes": "Number of life insurance policies for each
    administered life insurance program listed by state. Data is current as of 08/31/11.
     All programs are closed to new issues except for Service-Disabled Veterans' Insurance
    and Veterans' Mortgage Life Insurance.  United States Government Life Insurance
    was issued to WWI military personnel and Veterans.  National Service Life Insurance
    was established to meet the needs of WWII military personnel and Veterans.  Veterans'
    Special Life Insurance was issued to Korean War-era Veterans.  Veterans' Reopened
    Insurance provides coverage to certain classes of disabled Veterans from WWII and
    the Korean conflict who had dropped their government life insurance coverage.  Service-Disabled
    Veterans' Insurance was established in 1951 and is available to Veterans with service-connected
    disabilities.  Veterans' Mortgage Life Insurance was established in 1971 to provide
    mortgage protection life insurance to severely disabled Veterans who have received
    grants for the purchase of specially-adapted housing.",nt"license_title": "Creative
